  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Botany of The University
  of Tennessee is conducting a study of the plant ecology of Amchitka Island, Alaska,
  as a subcontractor for Battelle Memorial Institute of Columbus, Ohio. The primary
  purpose of the study is the gathering of basic information on the plant ecology
  of the island which will allow the prediction and assessment of the consequences
  of underground nuclear testing by the U.S. Atomic Energy Commission.\",\n\t\"owner_org\":
